// Railgun package versions - injected at build time
// This file is generated by the build process to include actual package versions

export const RAILGUN_VERSIONS = {
  wallet: '10.5.1', // @railgun-community/wallet
  shared_models: '8.0.0', // @railgun-community/shared-models  
  deployments: '0.4.9', // @railgun-community/deployments
};

// Helper to get version info
export function getRailgunVersions() {
  return {
    ...RAILGUN_VERSIONS,
    timestamp: new Date().toISOString(),
    userAgent: navigator.userAgent,
  };
}


